import React from "react";
import { BrowserRouter as Router, Route, Switch } from "react-router-dom";
import { match as Match } from "react-router-dom";
import "./index.css";
import { LoadAudioset } from "./LoadAudioset";
import NotFound from "./NotFound";

// App layout styles are defined at index.html
const AppRouter = () => {
  return (
    <Router>
      <Switch>
        <Route
          path="/"
          exact={true}
          render={() => <LoadAudioset id="index" />}
        />
        <Route
          path="/set/:id"
          exact={true}
          render={({ match }) => <LoadAudioset id={match.params.id} />}
        />
        <Route path="/test" exact={true} render={loadFromQueryString} />
        <Route component={NotFound} />
      </Switch>
    </Router>
  );
};

export default AppRouter;

function loadFromQueryString() {
  const params = new URLSearchParams(window.location.search);
  const url = params.get("url");
  return <div>{url}</div>;
}
